import { Route, Switch } from "react-router-dom";

import QuoteList from "./components/quotes/QuoteList";

function App() {
  return (
    <Switch>
      <Route path="/" exact>
        <QuoteList />
      </Route>
      <Route path="/all-quotes">All Quotes</Route>
      <Route path="/add-a-quote">Add a Quote</Route>
    </Switch>
  );
}

export default App;
